import React from 'react';
import './About.css';


const About = () => {

    const IMAGE_SRC = "./about_images/image1.JPG";
    return (
    <section className="about-section" id="about">
        <h2>About Me</h2>
        <div className="about-content">
        <div className="about-image">
            <img src={IMAGE_SRC} alt="Personal Photo" />
        </div>
        <div className="about-text">
            <p>Hello, my name is [Your Name]. I'm a [Your Profession].</p>
            {/* Add more text about yourself here */}
        </div>
        </div>
    </section>
    );
}

export default About;
